-- Name: status_type; Type: TABLE; Schema: earthchem; Owner: -
CREATE TABLE status_type (
    status_type_num integer NOT NULL,
    status_type_name character varying(255) NOT NULL,
    status_type_description character varying(4000),
	status_type_category character varying(255),
    source character varying(255),
    status integer DEFAULT 1,
    CONSTRAINT status_type_pkey PRIMARY KEY (status_type_num)
);
COMMENT ON TABLE status_type IS 'Status_type table proposed by Steve Richard to handle deprecating/activating/proposing new entries in the database. Schema and content duplicates table in EarthChem database.';




