-- new version of person_external_identifer table 2017-12-06
-- joins with person on person_num. GeoLink GUIDs included for possible linkage
-- Name: person_external_identifer1; Type: TABLE; Schema: public; Owner: grl_owner
--

CREATE TABLE person_external_identifer1 (
    id integer DEFAULT nextval('person_external_identifier1_id_seq'::regclass) NOT NULL,
    person_num integer,
    external_identifier_scheme text,
    external_identifier_value text,
    geolink_uuid uuid
);

COMMENT ON COLUMN public.person_external_identifer1.id
    IS 'primary key for correlation records. ';
COMMENT ON COLUMN public.person_external_identifer1.person_num
    IS 'Integer FK to join with preson';
COMMENT ON COLUMN public.person_external_identifer1.external_identifier_scheme
    IS 'Name of external_identifier_system (TBD--change to FK to external_identifier_system table)';
COMMENT ON COLUMN public.person_external_identifer1.external_identifier_value
    IS 'string value of identifier from the specified system that identifies the person';
COMMENT ON COLUMN public.person_external_identifer1.geolink_uuid
    IS 'GUID assigned by GeoLink to identify persons;';
	

