-- New tables added to build 2017-12-06
-- person1-- deduplicated person table with status field added
-- person_external_identifer1 correlation table using person_num to match to external IDs
--   instead of GeoLink GUIDS; also only has rows for persons in the ECL database (as of the 
--   de duplication by Peng in 2017-08)
-- Name: person1; Type: TABLE; Schema: public; 
--

CREATE TABLE person1 (
    person_num integer,
    first_name character varying(45),
    middle_initial character varying(20),
    last_name character varying(45),
    email character varying(100),
    approval smallint,
    status integer DEFAULT 2,
    CONSTRAINT person1_pkey PRIMARY KEY (person_num)
);




-- Name: author_list1; Type: TABLE; Schema: public; Owner: grl_owner
--

CREATE TABLE author_list1 (
    submission_id integer NOT NULL,
    person_num integer NOT NULL,
    author_order integer NOT NULL,
    old_person_num integer
);


